// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

interface IDigiplaza {

   enum CURRENCY{ ETH, TOKEN}


    struct Auction {
        bool active;
        address creator;
        address owner;
        uint256 value;
        uint256 endTime;
        CURRENCY currency;
    }


    function mintNFT( address recipient, string memory _metadata,  string memory _artwork) external returns (uint256);

    function listOnAuction(uint256 _tokenId, uint256 _price, CURRENCY currency) external returns (Auction memory);

    function bid(uint256 _tokenId) external payable returns (Auction memory);

    function bidToken(uint256 _tokenId, uint256 price) external returns (Auction memory);

    function claimNft(uint256 _tokenId) external returns (uint256);

    function withdraw(address _address, uint256 _value, CURRENCY currency) external ;

    function getTokenMetaData(uint256 _tokenId) external view returns (string memory);

    function getAuction(uint256 _tokenId) external view returns (Auction memory);

    function setTokenAddress(address tokenAddress) external ;

    function setFee(uint256 fee, uint256 tokenFee) external;

    function setNextBidPercentage(uint256 fee, uint256 tokenFee) external;


    event Mint(address indexed to, uint256  tokenId, string artwork);

    event ListOnAuction(address indexed owner, uint256  tokenId,uint256 price, uint256 endTime, CURRENCY currency);

    event Bid(address  bidder, uint256 indexed tokenId, uint256 value, CURRENCY currency);

    event ClaimNft(address collector, uint256 indexed tokenId);

}
